INSERT INTO `events` (`date`, `e_name`, `sno`, `poster`, `description`) VALUES
('2022-01-01', 'New Year\'s Day', 1, '', 'New Year\'s Day is a festival observed in most of the world on 1 January, the first day of the year in the modern Gregorian calendar. 1 January is also New Year\'s Day on the Julian calendar, but this is not the same day as the Gregorian one.'),
('2022-01-04', 'World Braille Day', 2, '', 'World Braille Day is an international day on 4 January and celebrates awareness of the importance of braille as a means of communication in the full realization of the human rights for blind and visually impaired people'),
('2022-01-06', 'World War Orphan Day', 3, '', 'The World Day of War Orphans is observed on January 6 every year. The day aims to raise awareness about children who have been orphaned due to wars. The objective of the day ensures to voice out the predicament of war orphans and highlight the emotional, social, and physical challenges children face while growing up.'),
('2022-01-10', 'World Hindi Day', 4, '', 'World Hindi Day or Vishwa Hindi Divas is celebrated every year on January 10 to mark the first World Hindi Conference that was held in 1975. It is celebrated across the world to promote the use of the Hindi language.'),
('2022-01-11', 'National Road Safety week', 5, '', 'To recognize the graveness of the matter and to enlighten people of the ways to become more cognizant about their safety on the road, the Government of India, in collaboration with various state governments, observes the National Road Safety Week from January 11 to January 17.'),
('2022-01-12', 'National Youth Day', 6, '', 'National Youth Day, also known as Vivekananda Jayanti, is celebrated on 12 January, being the birthday of Swami Vivekananda. In 1984 the Government of India declared this day as National Youth Day and since 1985 the event is celebrated in India every year.'),
('2022-01-14', 'Pongal', 7, '', 'Pongal is a harvest festival celebrated by the Tamil community. It is a celebration to thank the Sun, Mother Nature and the various farm animals that help to contribute to a bountiful harvest.'),
('2022-01-15', 'Indian Army Day', 8, '', 'Army Day is celebrated on 15 January every year in India, in recognition of Field Marshal Kodandera M. Cariappa\'s taking over as the first Commander-in-Chief of the Indian Army from General Francis Roy Bucher, the last British Commander-in-Chief of India, on 15 January 1949.'),
('2022-01-23', 'Birth anniversary of Netaji Subhas Chandra Bose', 9, '', 'Government announces 23rd January to be celebrated as “PARAKRAM DIWAS\' every year. Government of India has decided to celebrate the 125th Birth Anniversary year of Netaji Subhas Chandra Bose in a befitting manner at national and international level, beginning from 23rd January 2021.'),
('2022-01-24', 'National Girl child day', 10, '', 'The National Girl Child Day is celebrated in India every year on January 24th. It was initiated in 2008 by the Ministry of Women and Child Development and the government of India, in order to spread public awareness about inequities that girls face in Indian society.'),
('2022-01-24', 'International day of Education', 11, '', 'International Day of Education is an annual international observance day held on January 24 and is dedicated to education. On December 3, 2018, the United Nations General Assembly adopted a resolution proclaiming January 24 as International Day of Education, in celebration of the role of education for bringing global peace and sustainable development'),
('2022-01-25', 'National Voter\'s Day', 12, '', 'In order to encourage more young voters to take part in the political process, Government of India has decided to celebrate January 25 every year as \"National Voters\' Day\". It has been started from 25 January 2011 to mark Commission\'s foundation day.'),
('2022-01-25', 'National Tourism Day', 13, '', 'National Tourism Day is celebrated on January 25 every year across the country. This day is observed by the government to encourage tourism and explain the essential role of tourism in the growth of the country'),
('2022-01-26', 'Republic Day', 14, '', 'Republic Day is a public holiday in India, when the country marks and celebrates the date on which the Constitution of India came into effect on 26 January 1950, replacing the Government of India Act 1935 as the governing document of India and thus, turning the nation into a newly formed republic'),
('2022-01-30', 'Martyr\'s Day', 15, '', 'Martyrs\' Day also called Shaheed Diwas, is celebrated in India on January 30 and March 23 every year. 30th January is observed as Shaheed Diwas annually to mark the death anniversary of Mahatma Gandhi.'),
('2022-02-04', 'World Cancer Day', 16, '', 'World Cancer Day is an international day marked on 4 February to raise awareness of cancer and to encourage its prevention, detection, and treatment. World Cancer Day is led by the Union for International Cancer Control to support the goals of the World Cancer Declaration, written in 2008.'),
('2022-02-13', 'World Radio Day', 17, '', 'World Radio Day is an international day celebrated on 13 February each year. The Day was decided by UNESCO on 3 November 2011 during its 36th conference.'),
('2022-02-13', 'National Women\'s Day', 18, '', 'National Women’s Day is celebrated on Sarojini Naidu’s birthday the ‘Nightingale of India’. Check here the history, significance, wishes, and all you need to know about the Indian National Women’s Day.'),
('2022-02-21', 'International Mother Tongue Day', 19, '', 'International Mother Language Day is a worldwide annual observance held on 21 February to promote awareness of linguistic and cultural diversity and to promote multilingualism.'),
('2022-02-28', 'World Science Day', 20, '', 'World Science Day for Peace and Development is an international day that highlights the important role that science has in society and is celebrated each year on November 10. It also highlights the need to engage the wider public in debates on emerging scientific issues.'),
('2022-03-03', 'World Wildlife Day', 21, '', 'World Wildlife Day is an opportunity to celebrate the many beautiful and varied forms of wild fauna and flora and to raise awareness of the multitude of benefits that their conservation provides to people.'),
('2022-03-04', 'National Safety Day', 22, '', 'National Safety Day is observed every year in India on March 4 to generate awareness and commitment to working safely. It is aimed at renewing the commitment of employees and the general public to work safely throughout the year.'),
('2022-03-08', 'International Women\'s Day', 23, '', 'International Women\'s Day (March 8) is a global day for celebrating the social, economic, cultural and political achievements of women. The day also marks a call to action for accelerating gender parity.'),
('2022-03-18', 'Holi', 24, '', 'Holi is a popular ancient Hindu festival, also known as the \"Festival of Love\", the \"Festival of Colours\" and the \"Festival of Spring\". The festival celebrates the eternal and divine love of Radha Krishna'),
('2022-03-13', 'No Smoking Day', 25, '', 'In 1987, the World Health Assembly passed Resolution WHA40. 38, calling for 7 April 1988 to be a \"a world no-smoking day.\" In 1988, Resolution WHA42. 19 was passed, calling for the celebration of World No Tobacco Day, every year on 31 May.'),
('2022-03-14', 'PI Day', 26, '', 'Pi Day is an annual celebration of the mathematical constant π. Pi Day is observed on March 14 since 3, 1, and 4 are the first three significant digits of π. It was founded in 1988 by Larry Shaw, an employee of the Exploratorium. Celebrations often involve eating pie or holding pi recitation competitions.'),
('2022-03-16', 'National Vaccination Day', 27, '', 'World Immunization Week – celebrated every year in the last week of April – aims to promote the use of vaccines to protect people of all ages against disease. Immunization saves millions of lives every year and is widely recognized as one of the world\'s most successful health interventions.'),
('2022-03-20', 'International Day of Happiness', 28, '', 'The International Day of Happiness is celebrated throughout the world on 20 March. It was established by the United Nations General Assembly on 28 June 2012. The International Day of Happiness aims to make people around the world realize the importance of happiness within their lives.'),
('2022-03-21', 'World Forestry Day', 29, '', 'The UN General Assembly proclaimed March 21 as the International Day of Forests in 2012 to commemorate and raise awareness of the significance of all types of forests. This day is a reminder of the value of forests in the lives of living creatures'),
('2022-03-22', 'World Water Day', 30, '', 'World Water Day is an annual United Nations observance day held on 22 March that highlights the importance of fresh water. The day is used to advocate for the sustainable management of freshwater resources.'),
('2022-04-07', 'World Health Day', 31, '', 'World Health Day is a global health awareness day celebrated every year on 7 April, under the sponsorship of the World Health Organization, as well as other related organizations. In 1948, the WHO held the First World Health Assembly.'),
('2022-04-12', 'International Human Space Flight Day', 32, '', 'The International Day of Human Space Flight is the annual celebration, held on 12 April, of the anniversary of the first human space flight by Yuri Gagarin. It was proclaimed at the 65th session of the United Nations General Assembly on 7 April 2011, a few days before the 50th anniversary of the flight.'),
('2022-04-22', 'World Earth Day', 33, '', 'Earth Day is an annual event on April 22 to demonstrate support for environmental protection. First held on April 22, 1970, it now includes a wide range of events coordinated globally by EarthDay.org including 1 billion people in more than 193 countries.'),
('2022-05-01', 'Labour\'s Day', 34, '', 'Labour Day is an annual holiday to celebrate the achievements of workers. Labour Day has its origins in the labour union movement, specifically the eight-hour day movement, which advocated eight hours for work, eight hours for recreation, and eight hours for rest.'),
('2022-05-01', 'World Laughter Day', 35, '', 'World Laughter Day celebrated to raise awareness about laughter\'s healing benefits. Celebrated since 1998, World Laughter Day is an annual event celebrated to raise awareness about laughter and its many healing benefits.'),
('2022-05-08', 'World Red cross Day', 36, '', 'World Red Cross and Red Crescent Day is an annual celebration of the principles of the International Red Cross and Red Crescent Movement. World Red Cross Red Crescent Day is celebrated on 8 May each year. This date is the anniversary of the birth of Jean-Henry Dunant, who was born on 8 May 1828.'),
('2022-05-08', 'Mother\'s Day', 37, '', 'Mother\'s Day is a celebration honoring the mother of the family or individual, as well as motherhood, maternal bonds, and the influence of mothers in society. It is celebrated on different days in many parts of the world, most commonly in the months of March or May.'),
('2022-05-11', 'National Technology Day', 38, '', 'National Technology Day is celebrated on May 11 every year to commemorate the achievements of scientists, researchers, engineers and all others involved in the field of science and technology.'),
('2022-05-12', 'International Nurse\'s Day', 39, '', 'In January 1974, 12 May was chosen to celebrate the day as it is the anniversary of the birth of Florence Nightingale, the founder of modern nursing. Each year, ICN prepares and distributes the International Nurses\' Day Kit. The kit contains educational and public information materials, for use by nurses everywhere.'),
('2022-05-15', 'International Day of Family', 40, '', 'International Day of Families is annually observed by the United Nations across the world on May 15. The day is commemorated to highlight the important affairs central to the welfare of families, such as health, education, gender equality, rights for children, and social inclusion among others'),
('2022-05-31', 'Anti-Tobacco Day', 41, '', 'The Member States of the World Health Organization created World No Tobacco Day in 1987 to draw global attention to the tobacco epidemic and the preventable death and disease it causes. In 1987, the World Health Assembly passed Resolution WHA40.38, calling for 7 April 1988 to be a \"a world no-smoking day.\" In 1988, Resolution WHA42.19 was passed, calling for the celebration of World No Tobacco Day, every year on 31 May.'),
('2022-06-01', 'World Milk Day', 42, '', 'In 2001, World Milk Day was established by the Food and Agriculture Organisation of the United Nations to recognize the importance of milk as a global food, and to celebrate the dairy sector.'),
('2022-06-05', 'World Environment Day', 43, '', 'World Environment Day is observed on June 5 every year. The purpose of World Environment Day is to spread awareness about the threat to the environment due to rising pollution levels and climate change.'),
('2022-06-12', 'Anti-ChildLabour Day', 44, '', 'The Significance of the World Day Against Child Labour is to pay attention to the problem of child labour and to find ways to eradicate it. The day is used to spread awareness about the harmful mental and physical problems faced by children forced into child labour, all over the world.'),
('2022-06-19', 'Father\'s Day', 45, '', 'Father\'s Day is a celebration honoring people\'s fathers and celebrating the fatherhood, paternal bonds, and the influence of fathers in their society. It was first proposed by Sonora Dodd of Spokane, Washington in 1909. It is currently celebrated in the United States annually on the third Sunday in June.'),
('2022-06-23', 'International Olympic Day', 46, '', 'World Olympic Day was introduced in 1948 to commemorate the birth of the modern Olympic Games on June 23, 1894, at the Sorbonne in Paris. The goal of celebrating Olympic Day was to promote participation in sport across the globe regardless of age, gender, or athletic ability.'),
('2022-06-26', 'International Day against Drug Abuse', 47, '', 'The International Day Against Drug Abuse and Illicit Trafficking is observed every year on 26 June to spreading awareness about the serious issues caused because of drug abuse across the world. The aim is to strengthen action and cooperation to achieve the goal of an international society free of drug abuse.'),
('2022-07-01', 'Doctor\'s Day', 48, '', 'In India, National Doctors’ Day was first observed on 01 July 1991 in the honour of Dr. Bidhan Chandra Roy, to pay tribute to his contributions in health domain. July 01 happens to be his death and birth anniversary that coincides on the same date.'),
('2022-07-11', 'World Population Day', 49, '', 'World Population Day is observed every year on July 11. The main purpose of this day is to draw attention towards the issues arising out of rising population across the globe.'),
('2022-07-29', 'International Tiger Day', 50, '', 'Global Tiger Day is celebrated every year on July 29th as a way to raise awareness about this magnificent but endangered big cat. The day was founded in 2010, when the 13 tiger range countries came together to create Tx2 – the global goal to double the number of wild tigers by the year 2022.'),
('2022-08-07', 'Frienship\'s Day', 51, '', 'On the first Sunday in August, National Friendship Day encourages people across the country and world to connect with friends. Make a new friend or reconnect with an old one. Friendships come in many forms, and we begin developing them when we\'re very young.'),
('2022-08-09', 'Quit India Movement', 52, '', 'The Quit India Movement, also known as the August Movement, was a movement launched at the Bombay session of the All India Congress Committee by Mahatma Gandhi on 8 August 1942, during World War II, demanding an end to British rule in India.'),
('2022-08-12', 'International Youth day', 53, '', 'August 12 of every year is celebrated as the International Youth Day to raise awareness about the cultural and legal issues surrounding the youth.'),
('2022-08-26', 'Women\'s Equality Day', 54, '', 'Women\'s Equality Day is celebrated in the United States on August 26 to commemorate the 1920 adoption of the Nineteenth Amendment to the United States Constitution, which prohibits the states and the federal government from denying the right to vote to citizens of the United States on the basis of gender.'),
('2022-08-29', 'National Sports Day', 55, '', 'National Sports Day is a public holiday celebrated in various countries to honour the national sports teams and sports traditions of those countries. On this day people from different age groups take a part in sports like kabaddi, marathon, basketball, hockey etc.'),
('2022-09-05', 'Teacher\'s Day', 56, '', 'For India, the teachers\' day is celebrated to mark the birth anniversary of its second President Dr Sarvepalli Radhakrishnan. World teachers day marks the anniversary of the adoption of the 1966 recommendations regarding status, teaching practices and rights of teachers.'),
('2022-09-08', 'World Literacy Day', 57, '', 'Since 1967, International Literacy Day (ILD) celebrations have taken place annually around the world to remind the public of the importance of literacy as a matter of dignity and human rights, and to advance the literacy agenda towards a more literate and sustainable society.'),
('2022-09-15', 'Engineer\'s Day', 58, '', 'Every year the September 15th is celebrated as Engineer\'s Day in the country in recognition of Bharat Ratna Mokshagundam Visvesvaraya\'s contribution towards nation building.The birth anniversary of Sir M Visvesvaraya is celebrated as Engineer\'s Day since 1968 as a tribute to a the great engineer who helped in building some of the architectural marvels including Krishna Raja Sagar dam in Karnataka.'),
('2022-09-16', 'World Ozone Day', 59, '', 'In 1994, the United Nations General Assembly proclaimed 16 September the International Day for the Preservation of the Ozone Layer, commemorating the date of the signing, in 1987, of the Montreal Protocol on Substances that Deplete the Ozone Layer (resolution 49/114).'),
('2022-09-29', 'World Heart Day', 60, '', 'World heart day created by the World Heart Federation, World Heart Day informs people around the globe that CVD, including heart disease and stroke, is the world\'s leading cause of death claiming 18.6 million lives each year, and highlights the actions that individuals can take to prevent and control CVD.'),
('2022-10-01', 'International Day of the older person', 61, '', 'The aim of the day is to spread awareness about the need for health provisions and social care for elderly. On 14 December 1990, the United Nations General Assembly designated October 1 as the International Day of Older Persons.'),
('2022-10-02', 'Gandhi jayanti', 62, '', 'Gandhi Jayanti is celebrated on 2 October annually to mark the birth anniversary of Mohandas Karamchand Gandhi, popularly called Mahatma Gandhi and regarded as the Father of the Nation. This year marks the 152nd birth anniversary of Gandhi, who was born in Porbandar, Gujarat on 2 October 1869.'),
('2022-10-04', 'World Animal Welfare Day', 63, '', 'The day focuses on creating awareness about the effects of individuals, businesses and other human behaviours on animals. It is also known as \'Animal Lovers Day\' as it encourages love, care, affection and protection of animals through the involvement of individuals and organisations who work for the rights of animals.'),
('2022-10-08', 'Indian Airforce Day', 64, '', 'Every year on 8 October, the country observes the Indian Air Force Day (IAF). The day is celebrated to raise awareness around the world about IAF as an organisation that works towards strengthening national security.'),
('2022-10-09', 'World Postal Day', 65, '', 'The purpose of World Post Day is to create awareness of the role of the postal sector in people\'s and businesses\' everyday lives and its contribution to the social and economic development of countries.'),
('2022-10-16', 'World Food Day', 66, '', 'World Food Day is celebrated all over the world on October 16. It is an initiative by the Food and Agricultural Organisation (FAO) of the United Nations. This global event marks a day calling for worldwide awareness and collective action to combat the issue of hunger and ensure healthy diets for all'),
('2022-10-17', 'International Poverty Eradication Day', 67, '', 'The International Day for the Eradication of Poverty is held annually on 17 October to provide: an opportunity to acknowledge the effort and struggle of people living in poverty; a chance for them to make their concerns heard; and. a moment to recognize that poor people are the first ones to fight against poverty.'),
('2022-11-09', 'World Services Day', 68, '', 'Every year on June 23, the United Nations Public Service Day recognises the value and virtue of public service to the community. This day emphasizes the importance of public service in the advancement phase, recognises the work of public servants and inspires young people to undertake careers in the public sector.'),
('2022-11-14', 'Children\'s Day', 69, '', 'Every year 14 November is celebrated as Children\'s Day to pay tribute to our former Prime Minister, Pandit Jawahar Lal Nehru, for his contribution to building the nation. It is a day celebrating the spirit of childhood.'),
('2022-11-18', 'World Adult Day', 70, '', 'World Adult Day is celebrated on 18 November. It is organised by the World Health Organization. It is celebrated to tackle the growing aging problem. It is an initiative to urge adults to live with their old parents and help them.'),
('2022-11-19', 'World Citizen Day', 71, '', 'World Citizen Day is an annual celebration observed on November 19th of every year. Being a citizen of the world makes a closer bonding with people of different cultures, religions, races, and locations.'),
('2022-11-21', 'World Television Day', 72, '', 'World Television Day is commemorated on 21 November every year. The day is a reminder of the power of visual media and how it helps in shaping public opinion and influencing world politics. Television has played a significant role in the lives of people for years.'),
('2022-11-26', 'Law Day', 73, '', 'National Law Day, also known as Constitution Day or Samvidhan Divas, is celebrated in India on 26th November every year to commemorate the adoption of the Constitution of India. On 26th November 1949, the Constituent Assembly of India adopted the Constitution of India, which came into effect from 26th January 1950.'),
('2022-12-01', 'World AIDS Day', 74, '', 'World AIDS Day, designated on 1 December every year since 1988, is an international day dedicated to raising awareness of the AIDS pandemic caused by the spread of HIV infection and mourning those who have died of the disease.'),
('2022-12-02', 'National Pollution Control Day', 75, '', 'National Pollution Control Day 2021 is observed annually on December 2 to remember the people who lost lives during 1984 Bhopal Gas Tragedy. It is also the day to raise awareness about the hazards of air pollution.'),
('2022-12-04', 'Indian Navy Day', 76, '', 'The day is celebrated to respect the Indian Navy\'s counter-attack in Operation Trident during the Indo-Pakistan war in 1971. The Indian Navy Day is observed on December 4 every year to recognise the efforts and achievements of the Indian Navy in Operation Trident conducted during the Indo-Pakistan war in 1971.'),
('2022-12-05', 'International Volunteer Day', 77, '', 'International Volunteer Day (IVD), also called International Volunteer Day for Economic and Social Development is observed on 5 December every year. International Volunteer Day Theme 2021: “Volunteer now for our common future”. The purpose of the day to celebrate the efforts of volunteers and organizations and offer the opportunity to promote volunteerism, encourage governments to support volunteer efforts and recognize volunteer contributions to the achievement of the Sustainable Development Go'),
('2022-12-10', 'Human Rights Day', 78, '', 'Human Rights Day is observed by the international community every year on 10 December. It commemorates the day in 1948 the United Nations General Assembly adopted the Universal Declaration of Human Rights.'),
('2022-12-14', 'National Energy Conservation Day', 79, '', 'The National Energy Conservation Day is observed on December 14th, every year by the Bureau of Energy Efficiency (BEE). The day focuses on making people aware of global warming and climate change and promotes efforts towards saving energy resources.'),
('2022-12-22', 'National Mathematics Day', 80, '', 'Every year, December 22 is celebrated as National Mathematics Day in India in honour of mathematical genius Srinivasa Ramanujan (1887-1920). The celebrations were announced by the then Prime Minister Manmohan Singh at Madras University in 2012.'),
('2022-12-23', 'Farmer\'s Day', 81, '', 'December 23 is celebrated as Kisan Diwas to mark the birth anniversary of former Prime Minister and farmer leader Chaudhary Charan Singh. New Delhi: Kisan Diwas, or National Farmers\' Day, is celebrated to mark the birth anniversary of former Prime Minister and farmer leader Chaudhary Charan Singh.'),
('2022-12-25', 'Christmas Day', 82, '', 'Christmas Day is an annual Christian festival commemorating the birth of Jesus Christ, the Son of God. Specifically, the meaning of Christmas comes in the remembrance and celebration of God\'s presence in our world through Jesus, God-made flesh.'),
('2022-12-31', 'New Year\'s Eve', 83, '', 'In the Gregorian calendar, New Year\'s Eve, also known as Old Year\'s Day or Saint Sylvester\'s Day in many countries, the evening or the entire day of the last day of the year, is on 31 December. The last day of the year is commonly referred to as “New Year’s Eve”.');
